On Escalation Ticket # 00419624 the new comment has been added: Robert Zavalczki:

@WaitingOnEngineer by doing intensive testing and review I found something that might cause a crash in SSLsplit due to thread safety issues: libevent is not always used in a thread-safe manner. I will make a fix for this issue and probably push to include it in the 5.9.4.1 release.

